        //Processes the station data raw string into RtStationData type
        private static void ProcessStationDatas()
        {
            string[] StationDatas = GetRawStationData().Split(DATALINESPLITCHAR);
            _RtStationDatas = new RtStationData[StationDatas.Length];

            for (int i = MININDEX; i < StationDatas.Length; i++)
            {
                string[] StationDataBits = StationDatas[i].Split(DATABITSSPLITCHAR);

                RtStationData newStationData = new RtStationData(StationDataBits[STATIONNAMEINDEX], StationDataBits[CRSINDEX],
                    Convert.ToDouble(StationDataBits[EASTINGINDEX]), Convert.ToDouble(StationDataBits[NORTHINGINDEX]),
                    OS_LatLong.ConvertOSToLatLon(Convert.ToDouble(StationDataBits[EASTINGINDEX]),
                    Convert.ToDouble(StationDataBits[NORTHINGINDEX])));
                _RtStationDatas[i] = newStationData;
            }

            IndexStationDatas();
        }

        //Process the station datas by calculating the starting index of letters
        private static void IndexStationDatas()
        {
            //Set up Station Alphabetic Index's Assigning Chars to indexs.
            _StationDatasAlphabeticIndexs = new StationDatasAlphabeticIndex[26];
            for (int i = CHAROFFSETA; i < CHAROFFSETZ; i++)
            {
                _StationDatasAlphabeticIndexs[i - CHAROFFSETA] = new StationDatasAlphabeticIndex();
                _StationDatasAlphabeticIndexs[i - CHAROFFSETA].Letter = (char)i;
                _StationDatasAlphabeticIndexs[i - CHAROFFSETA].StartingIndex = -ONE;
                _StationDatasAlphabeticIndexs[i - CHAROFFSETA].EndingIndex = -ONE;
            }

            //Loop through station datas. If first letter is ? then 
            //if first index for that letter isnt set, set it. And set it as last index too.
            for (int i = MININDEX; i < _RtStationDatas.Length; i++)
            {
                for (int d = MININDEX; d < _StationDatasAlphabeticIndexs.Length; d++)
                {
                    if (_RtStationDatas[i].StationName[MININDEX] == _StationDatasAlphabeticIndexs[d].Letter)
                    {
                        if (_StationDatasAlphabeticIndexs[d].StartingIndex == -ONE)
                            _StationDatasAlphabeticIndexs[d].StartingIndex = i;
                        _StationDatasAlphabeticIndexs[d].EndingIndex = i;
                    }
                }
            }
        }
    }
